import React from "react";
import { makeStyles } from "@mui/styles";

const useStyles = makeStyles({
  page: {
    backgroundColor: "pink",
    width: "100%",
  },
});

const Layout = (props) => {
  const classes = useStyles();

  return (
    <div>
      <div className={classes.page}>{props.children}</div>
    </div>
  );
};

export default Layout;
